
var KalturaSubtitlesService={get:function(id){var kparams=new Object();kparams.id=id;return new KalturaRequestBuilder("subtitles","get",kparams);},listAction:function(filter,pager){var kparams=new Object();kparams.filter=filter;kparams.pager=pager;return new KalturaRequestBuilder("subtitles","list",kparams);},uploadFile:function(subtitles,file){var kparams=new Object();var kfiles=new Object();kparams.subtitles=subtitles;kfiles.file=file;return new KalturaRequestBuilder("subtitles","uploadFile",kparams,kfiles);}}